import React from 'react'
import styled from 'styled-components'

const Container=styled.div`
width: 100%;
height: 100vh;
background-color: black;
`;

const StyleWrapper=styled.div`
width: 20px;
height: 20px;
background-color: yellow;
margin: 100px auto;
`;


const TextingDeals = () => {
    return (
       <Container>
           <StyleWrapper>

           </StyleWrapper>
       </Container>
    )
}

export default TextingDeals
